            "title": "Energize",
            "description": "We partner with entrepreneurs to advance the next generation of energy & industry.",
            "tagline": "We partner with entrepreneurs to advance the next generation of energy & industry.",
            "about": "Partnering with Entrepreneurs to Digitize Energy and Industrial Companies. \n\nEnergize Ventures is a venture fund investing in pre-growth stage technology companies that are changing the game in energy. We are investing in digital solutions that make energy and industrial companies more affordable, reliable, and secure. By optimizing today’s energy and industrial infrastructure and equipment, we believe we can drive greater system efficiency to make renewable energy the default generation choice now and into the foreseeable future. We know the challenges of developing and commercializing hardware and software products and services. We bring our know-how and network to every investment. We’re centered on the application layer—technologies that improve the performance and value of existing assets. We look for data-focused, decentralized tech and platforms capable of exponential growth. Our Investment Focus is the \"digital application layer\"​ and spans six verticals: Data Analytics, Cyber Security, Distributed Energy Resources, Energy Storage, Operational Efficiency, and Mobility. \n\nIf you are an entrepreneur executing on a mission and these thoughts resonate with you, please reach out. \n\n@energizevc",
