            "title": "Keiki Capital",
            "description": "Early Stage Investor in Decarbonization and Climate Adaptation",
            "tagline": "Early Stage Investor in Decarbonization and Climate Adaptation",
            "about": "Formed in 2017, Keiki Capital is an investment company predicated on the idea that there is tremendous economic and social value in developing and investing in these disruptive technologies and business models. We recognize the emergence of a climate tech renaissance fueled by the scale of the challenge and a new wave of talent and innovative solutions. We believe that the companies that will have the biggest impact on climate from 2030 to 2040 are being incubated in garages and universities today. Those that find traction will outperform all other sectors of the economy over the next five to fifteen years, and the most successful among them will join the ranks of the most valuable companies in the world. Our work is to invest in, support, and enable these companies and their founders.",
