function filtercapitals(capitals, filters) {
    return capitals.filter(org => {
        const countryMatch = filters.country ? (org.hqLocation?.country && org.hqLocation.country.toLowerCase() === filters.country.toLowerCase()) : true;
        const orgTypeMatch = filters.orgType ? (org.orgType && org.orgType.toLowerCase() === filters.orgType.toLowerCase()) : true;
        const strategic = filters.strategic ? (org.capitalProfile && org.capitalProfile.strategic === filters.strategic) : true;
        const checkSize = filters.checkSize ? (org.capitalProfile && org.capitalProfile.checkSize && org.capitalProfile.checkSize.map(t => t.toLowerCase()).includes(filters.checkSize.toLowerCase())) : true;
        const focusaria = filters.focusaria ? (getCategoryNameFromSlug(org, filters.focusaria.toLowerCase())) : true;
        const impactSpecific = filters.impactSpecific ? (org.capitalProfile && org.capitalProfile.impactSpecific === filters.impactSpecific) : true;
        const capital = filters.capital ? (org.capitalProfile && org.capitalProfile.type && org.capitalProfile.type.map(t => t.toLowerCase()).includes(filters.capital.toLowerCase())) : true;
        // console.log(countryMatch)
        // console.log(strategic)
        // console.log(roleMatch)
        // console.log(orgTypeMatch)
        // console.log(categoryMatch)

        return focusaria && countryMatch && strategic && checkSize && orgTypeMatch && impactSpecific && capital;
    });
}

function getCategoryNameFromSlug(org, mys) {

    for (let i = 0; i < org.categories.length; i++) {
        const category = org.categories[i];

        // Determine which slug to use based on the presence of 'parent'
        // const slugToCheck = category.parent ? category.parent.slug : category.slug;

        // Extract the category name from the slug
        // const parts = slugToCheck.split('/');
        const extractedCategoryName = category.name;

        // Check if the extracted category name matches the specified category name
        if (extractedCategoryName.toLowerCase() === mys) {
            return true; 
        }
    }
    return false;
}

function displayCapital(capital) {
    const table = document.querySelector("#capitalTable tbody");
    table.innerHTML = ""; // Clear the table

    capital.forEach(cap => {
        const row = document.createElement("tr");

        // Assuming cap is an object with properties: recordId, title, description, location, headcount, orgType
        const cell1 = document.createElement("td");
        cell1.textContent = cap.recordId;
        row.appendChild(cell1);

        const cell2 = document.createElement("td");
        cell2.textContent = cap.title;
        row.appendChild(cell2);

        const cell4 = document.createElement("td");
        cell4.textContent = cap.location;
        row.appendChild(cell4);

        const cell5 = document.createElement("td");
        cell5.textContent = cap.headcount;
        row.appendChild(cell5);

        const cell6 = document.createElement("td");
        cell6.textContent = cap.orgType;
        row.appendChild(cell6);

        const cell3 = document.createElement("td");
        cell3.textContent = cap.description;
        row.appendChild(cell3);

        table.appendChild(row);
    });
}

